import styles from '../styles/pages/Loading.module.css'


export default function Erro404() {
  return (
    <div className={styles.container}>
      <Link to={'/'} >

        <i class="fas fa-reply-all"></i>

      </Link>
      <img src='http://localhost:3001/uploads/loading.gif' alt="Loading" />
    </div>
  )
}
